import "./header.css";
import "./container.css";

const Header = () => {
  return (
    <div className='header'>
        <div className='container'>
            <h2>Onni.</h2>
            <ul>
                <li>
                    <a href="#about">About</a>
                </li>
                <li>
                    <a href="#about">Skills</a>
                </li>
                <li>
                    <a href="#about">Projects</a>
                </li>
                <li>
                    <a href="#about">Contacts</a>
                </li>
            </ul>
        </div>
    </div>
  );
};

export default Header;
